(2686, 1, '2016-09-28 15:08:45', '2016-09-28 15:08:45', 'This is an example page. It''s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I''m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin'' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href="http://uouapps.a2hosted.com/rentify/wp-admin/">your dashboard</a> to delete this page and create new pages for your content. Have fun!', 'Sample Page', '', 'publish', 'closed', 'open', '', 'sample-page', '', '', '2016-09-28 15:08:45', '2016-09-28 15:08:45', '', 0, 'http://uouapps.a2hosted.com/rentify/?page_id=2', 0, 'page', '', 0),
(47, 1, '2010-03-18 16:17:15', '2010-03-18 16:17:15', 'A little known Norwegian airline website named <a href="http://www.wideroe.no/" target="_blank">Widerøe</a> generated a tremendous amount of buzz and a lot of very happy customers this weekend when word got out that supposed unintentional error in their reservation system was allowing people to book international tickets on United Airlines and its affiliated carriers at incredibly low prices. As sometimes happens, however, things are not always as they seem.\n\nTo give you an idea of the types of deals we''re talking about, how about $130 round-trip from New York to Milan, Italy? That''s not the base fare before tax—that''s the <b>total</b> fare including all taxes and fees. Other examples include $280 roundtrip from Los Angeles to Dubai in the UAE, and $298 from Houston to Bombay, India. These are just a small smattering of the incredible deals that lucky travelers scored on Saturday and at least part of Sunday. Unheard of fares were available from across the U.S. to Europe, Asia, Africa and the Middle East.', 'Lorem ipsum dolor sit amet consectetur', '', 'publish', 'open', 'open', '', 'lorem-ipsum-dolor-sit-amet-consectetur', '', '', '2010-03-18 16:17:15', '2010-03-18 16:17:15', '', 0, 'http://autorent.dev/?p=41', 3, 'post', '', 0),
